(9, 'SKY Toyshop', NULL, '1471536836.jpg', NULL, '1471536836.jpg', 'Jalan Dua, Taman Dua, 83000 Batu Pahat', '<p>Today, with over 5 years of experience in bringing smiles and laughter to children, SKY Toyshop is known and trusted all over the Asia. Email us to get your order ready!</p>', '+60127625999', 'ktp1101@yahoo.com', '', '83000', '1.871679', '102.952629', 8, '2016-07-21 14:20:20', 0, '0000-00-00', '0000-00-00', 18, 'Kids toys', '604e837d883dc7d402ed733c42809ecbbc5480a45ff575fcdde26aa03985397d', '', '9am- 9pm', 0),
(10, 'Darts Bistro', NULL, '1471448872.jpg', NULL, '1471358511.jpg', 'No. 65, Jalan Flora Utama 8, Taman Flora Utama, 83000 Batu Pahat, Johor.', '<p class="p1"><span class="s1">Darts Bistro provides different live bands with different visual effect from Monday to Friday. Darts Bistro is also having varieties of food and alcohol drinks, everyone can enjoy a brand new drinking experience here.<br></span><span class="s2"><br>Darts Bistro </span><span class="s1">每逢星期一到星期五都会有带来不一样视觉效果的现场乐队。</span><span class="s2">Darts Bistro</span><span class="s1">也拥有美味的食物与酒类提供，大家能够在这里体验味觉与听觉的享受。</span></p>', '010-9717077', 'dartsbistro@gmail.com', '', '', '1.868514', '102.949642', 8, '2016-08-16 22:41:51', 1, '2016-10-14', '2017-10-14', 16, 'Drink.Chat.Darts', 'df15d697024311686cb47a1f0e65bdc0a230143e588b275bede94a36cc15a57f', '', '10-10pm', 1),
(11, 'Gordanlau Hairdressing', NULL, '1471449132.jpg', NULL, 'c_1472139392_036b8aa055e12dbe97b75599b7adf51c.jpg', 'No. 96, Jalan Maju Timur, Taman Maju, 83000 Batu Pahat, Johor.', '<p>to be provided soon.</p>', '016-7873888', 'gordanlau@hotmail.com', '', '', '1.869281', '102.942969', 6, '2016-08-17 22:40:57', 1, '0000-00-00', '0000-00-00', 15, 'Salon / 美发', '2ecaa2bedfe97ea9c2b0b31e237530a448c811ee33a15dc9248f3c6690312c1a', '', '', 1),
(12, 'Lim Cheng Huat Trading', NULL, '1471448935.jpg', NULL, 'c_1473267561_a8154c82a7533da14dd4b50371ed21ac.jpg', '16.4, Jalan Engan, 83000 Batu Pahat, Johor.', '<p class="p1">Cheng Huat Trading founded on 1990, the main service is providing all products for praying in one stop. We sells strawberry, blueberry, peach, kiwi and others imported fruits. </p>\r\n<p> </p>\r\n<p class="p2">清发生果店成立于1990年，宗旨在于提供给顾客齐全的拜神用品， 可说是麻雀虽小<span class="s2">,</span>五脏俱全，拥有的水果种类更是不胜枚举，草莓，蓝莓，桃子，奇异果和其它进口水果都有。</p>', '07-4325141', 'limchenghuat@gmail.com', '', '', '1.849243', '102.926082', 5, '2016-08-17 23:30:11', 1, '0000-00-00', '0000-00-00', 18, 'Fruit / 水果', 'c75f9a2ff953bb184cff75d6085bc544f63224d7c5ce894bbc48838434755402', '', '8:30am - 6:30pm', 1),
(13, 'Thai Style Traditional Massage', NULL, 'l_1472911081_ccfdddf8e514ca2f738f3699168f4440.jpg', NULL, 'c_1473267986_d57c44b924664609b5664140b028cff8.jpg', '4 & 4A Jalan Setia Jaya 2, Taman Setia Jaya', '<p>正宗泰式按摩养生阁<br>本店位于金宝花园，（水记炖汤隔壁）环境舒适整洁。<br>本店的服务项目：放松按摩，足部按摩，泰式古方按摩，精油按摩，泰式草药包疗法。<br>您将全身心放松在专业的按摩技术中，在忙碌的都市生活中休闲减压，享受的私人空间，有我们的技师为你提供最优质的服务。</p>\r\n<p>～快快联络我们吧～</p>', '0127113611', 'sales@liveads88.com', '', '83000', '1.867510', '102.945462', 3, '2016-09-02 17:54:12', 1, '0000-00-00', '0000-00-00', 19, 'Thai Style Traditional Massage', '37268335dd6931045bdcdf92623ff819a64244b53d0e746d438797349d4da578', '-', '10am - 12am', 0),
(14, 'Kenzocreatives.com | Branding Agency', NULL, 'l_1472975434_65f4a64b294f66b53afe6cc904f1e742.jpg', NULL, 'c_1472970775_da6532c37357631f688f4607f2d9aa1f.jpg', 'Jalan Dua, Taman Dua', '<p>KenzoCreatives was born by a group of friends who has the same vision in 2010 with idea of a niche agency that was able to cover all facets of design and technical development. After gaining broad experience in the graphic design, web development, advertising and iPhone App Developments, their aim was to apply this knowledge to provide a consistent and complete design approach for businesses across a broad range of media.</p>', '0127625999', 'enquiry@kenzocreatives.com', 'www.kenzocreatives.com', '8300000', '1.871414', '102.952907', 7, '2016-09-04 14:32:54', 1, '0000-00-00', '0000-00-00', 18, 'creatives, website, flyers, agency', '8fffa36c5c88e50aa080a59adf240ec094f96461d53d943a764f3dff978f5e22', '-', '9am - 9pm', 1),
(15, 'Fanny Skintastic Fitness & Beauty', NULL, 'l_1472985218_7f9beedf776c9710ee53db4f45f79c8f.jpg', NULL, 'c_1472985218_feeefb79eb86e2205c6725d31a97d1e2.jpg', 'No. 66, Jalan FLora Utama 8, Taman Flora Utama', '<p class="p1"><span class="s1"><strong>Our Beauty Parlor includes:</strong></span></p>\r\n<ul>\r\n<li>Facial, Slimming, Waxing Treatment</li>\r\n<li>Eyebrow, Eyeliner & Lips Embrodeiry</li>\r\n<li>Eyelash Extension (3D, 6D, 9D)</li>\r\n<li>Eyebrow & Eyelash Extension Course</li>\r\n</ul>\r\n<p class="p1"><span class="s1">WeChat: fannyskintastic1230, Facebook: FanySkintastic Fitness & Beauty</span></p>', '0183794896', 'nyf89@hotmail.com', '-', '83000', '1.866147', '102.950546', 8, '2016-09-04 18:33:38', 1, '0000-00-00', '0000-00-00', 15, 'Facial, Slimming, Waxing treatment', '4a5ad411b1d2ecb02d09b21445726b2465a19e6d450d31057a9bea8e61604e84', '-', ' 10am - 7pm', 0),
(16, 'Agensi Pekerjaan Unilink Sdn Bhd', NULL, 'l_1473525413_fc4550a2fd0f5d84d895f30b00263294.jpg', NULL, 'c_1473525413_826ec722e47dfdf4c5681a4569e0b67d.jpg', 'No. 10A, Jalan Flora Utama 2, Taman Flora Utama, 83000 Batu Pahat, Johor', '<p>Unilink is a "one-stop centre" in providing professional management consultancy services specializing in manpower recruitment and supplies of foreign workers, resource management & organization development and company secretarial services. Unilink is managed by a group of dedicated and experienced staff with the relevant expertise to assist you in accomplishing your job. We deliver high quality services to businesses of all types, size and level of management. During the past decade, Unilink has accomplished many tasks and met the satisfaction of business entrepreneurs in solving essential matters and achieving goals, solving matters related to foreign workers and immigration and, application to all relevant Authority. It is our commitment to meet your satisfaction.<br><br>8:30am - 6pm(Monday-Friday), 9am - 1pm(Saturday), off Sunday</p>', '07-4343353', 'info@ugoc.com.my', 'www.ugoc.com.my', '83000', '43.1146883', '5.9488975', 3, '2016-09-11 00:36:53', 1, '0000-00-00', '0000-00-00', 18, 'Manpower & license applications', '62720d67554f98e7976a3242be1dc49917275fe857dcc814b0931ef9a7813bd4', '-', '8:30am - 6pm (Mon-Fri)', 0),
(17, 'Roundabout Kopitiam Kafe', NULL, 'l_1473526669_cd38d43c4ac9136894092c0be92c3774.jpg', NULL, 'c_1473526669_ae0cd0d1bbffd93b96951fe7d317305d.jpg', 'No. 36-1 & 36-2, Jalan Kluang(Simpang Rantai), 83000 Batu Pahat, Johor', '<p>This is a place with vintage design, the decoration is using 1950’s concept. The business starts from early morning with locally food such as mee siam, roti bakar, half boiled egg and fresh-brew local white coffee. lunch time they serve famous Sarawak food, like kolo mee and Sarawak laksa. At night, you can enjoy varieties of western food and snacks. </p>', '018-6694958', 'roundabout.kopitiam@gmail.com', '-', '83000', '1.847081', '102.937979', 9, '2016-09-11 00:57:49', 1, '0000-00-00', '0000-00-00', 16, 'Food & Drink', '75c7d7184d93733ca076bd839c8f3050f146a77e10a4a45e573bd9a6143fb92f', '-', '7am - 3am', 0),
(18, 'MYLiveAds', NULL, 'l_1476460377_d940b9414b4a9c49d9158329cf5f17e1.jpg', NULL, 'c_1476461236_38ec651395f7c074e904f6929416a764.jpg', 'No. 7 (1st Floor), Jalan Pesta 1/1, Taman Tun Dr. Ismail 1, Jalan Bakri,', '<p>MyLiveAds is one of the Malaysia''s largest online marketplace, to become Asia''s leading online marketplace. MyLiveAds provides a powerful online marketplace platform that allows its buyer enjoy highly secure and convenient shopping experience. Our vision is to bring together diverse customers and merchants worldwide and improve life everyday, everywhere. We will strive to provide enjoyable and great shopping experience.</p>', '0167960787', 'sales@liveads88.com', 'www.liveads88.com', '84000', '2.049160', '102.586923', 5, '2016-10-14 23:52:56', 1, '0000-00-00', '0000-00-00', 18, 'advertisement, broadcast, promotions, deals, coupons, sharing, marketing', '604e837d883dc7d402ed733c42809ecbbc5480a45ff575fcdde26aa03985397d', '', '9am - 6pm', 1),
(19, 'Tian Xiang Hainanese Chicken Rice', NULL, 'l_1476693310_a5109f6b8a746ab3d0a18e232b2295e4.jpg', NULL, 'c_1476546286_e251b0d8a08ee6ad52feb1e8dfbf5b30.jpg', 'No.30, Jalan Setia Utama, Taman Setiajaya, 83000, Batu Pahat. Johor.', '<p>还在烦恼午餐地点吗？现在推荐你一个好去处！ 天香海南芽菜鸡饭店或许合你心意！鸡饭店成立于2007年。随着时代的改变，菜单也更着多样化。店里的佳肴不再单调（备有叉烧，烧肉，沙拉鸡排，鱼排，鸡肝，腱，玻璃鸡脚，卤蛋，豆干，豆腐，油菜）！价格经济实惠！这间店位于市区的TAMAN MAJU，方便寻找。这里来个温馨提醒，如果要外带，本店有提供预定服务哦~~~ 因为午餐时段比较繁忙，各位顾客的时间都是宝贵的 。</p>\r\n<table class="t1" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="td1" valign="baseline">\r\n<p class="p1"><span class="s1">Looking for a luncheon venue? Come to Tian Xiang Hainanese Chicken Rice at Taman Maju which may suit you! Since its establishment in 2007, Tian Xiang Hainanese Chicken Rice has evolved into a well-known eatery in Batu Pahat with a variety of mouth-watering dishes at affordable prices like Barbecue Pork Strips, Roast Pork, Chicken Chop Salad, Crispy Fish Fillet, Chicken Liver, Chicken Feet, Braised Beancurd, Steam Vegetables and many more. It''s easily located at the heart of Taman Maju. A warmth note to all: Tian Xiang Hainanese Chicken Rice accepts tele-orders for a take away because time is a precious commodity to our customers. Call up now!</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '012-740 0246', 'tianxiangchickenrice@gmail.com', '', '', '1.868708', '102.945236', 8, '2016-10-15 23:44:46', 1, '2016-10-15', '2018-01-15', 12, 'Food, Drink & Booking', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '9am-6pm ', 1),
(20, 'Wiwi Chicken Rice', NULL, 'l_1476549167_e9b96a2a3ac62fe374cb1e9bbab7faba.jpg', NULL, 'c_1476548612_e07d2a372dbe82f735c7926b67805507.jpg', '62 & 64, Jalan Setia Jaya Utama, Taman Setia Jaya, 83000, Batu Pahat', '<p>烧肉，一道家喻户晓的传统美食。烧肉店各处有，但是让人印象深刻真的不多间。偉偉就是其中一间能让您有机会再品尝古早味的烧肉店。这间店也提供各式小菜。如烧鸡，白鸡，叉烧，烧鸭，鱼，猪和鸡排，豆腐，鸡脚，芽菜，油菜，卤蛋和卤豆腐值得一试！本店提供预订服务，为了让客户可以争取更多繁忙午饭时间慢慢享用。</p>\r\n<table class="t1" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="td1" valign="baseline">\r\n<p class="p1"><span class="s1">WiWi Chicken Rice ... well it''s more than just chicken rice! You can find the most traditional recipe of Roast Pork in town which will spoil your tastebuds. Roast Chicken, Steam Chicken, Barbecue pork, Roast Duck, Fish, Pork Chop, Chicken Chop, Bean Sprout in Soya Sauce, Season Greens and Braised Beancurd are all worth a try! WiWi Chicken Rice also accept pre-order service when ample time is left for your taste buds instead of waiting.</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '012-711 1499', 'weeshen9829@hotmail.com', '', '83000', '1.868679', '102.944695', 4, '2016-10-16 00:23:32', 1, '2016-10-16', '2018-01-16', 12, 'Food, Drink & Booking', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '9am-5pm ', 1),
(21, 'Morning Restaurant (猪小弟)', NULL, 'l_1476588175_11916b1d5e33e33e1a45f44a666c3181.jpg', NULL, 'c_1476588175_0563bba1f1150a62e020e1e3ff51e74d.jpg', 'No.57,Jalan Setia Jaya Utama,Taman Setia Jaya,Jln.Tan Swe Hoe 83000,Batu Pahat.johor.', '<p class="p1">猪小弟排骨面始于<span class="s1">1993</span>年，原先以档口经营，至<span class="s1">2010</span>转入店面营业，营业至今已有<span class="s1">23</span>年。转入店面营业后，增加售卖肉粹面，水饺汤，鱼圆面，及酿豆腐，以让顾客有更多选择。</p>\r\n<p class="p2">The Little Piggy SpareRibs Noodles has grown from a humble stall in Year 1993 to a renowned eatery in Batu Pahat in Year 2010. Enriched with 23 years of culinary experience,  the Little Piggy has pioneered and developed its own recipe of Minced Pork Noodles, Dumplings in Soup, Fishballs Noodles and Stuffed Beancurd or commonly known as "Yong-Tou-Fu" when you will be spoiled with varieties and choices.</p>', '012-7717181', 'morningrestaurant1993@gmail.com', '', '', '1.868518', '102.945000', 6, '2016-10-16 11:22:54', 1, '2016-10-16', '2018-01-16', 12, 'Food,  Drink & Booking', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '8.30am -4.30pm', 0),
(22, 'BP Computer Centre (Supernet Computer)', NULL, 'l_1476593459_9812b4b0f3a404ebef37d3218e1e4241.jpg', NULL, 'c_1476593459_531693c0e4713b2a7dc8741f94819d58.jpg', '49 & 49A, Jalan Kuning, Taman Murni,83000 Batu Pahat, Johor, Malaysia.', '<p> 2000 has been operating since. Now have  provide -Accessories. Printer. F & B Retail Software. Networking. Consultancy. Yes & Webe Authorison Register Center.</p>', '012-754 3346', 'supernetcom@gmail.com', '', '83000', '1.863723', '102.941841', 5, '2016-10-16 12:50:59', 1, '2016-10-16', '2018-01-16', 18, 'Computer Sales & Service', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '10am-7pm (off Sunday)', 0),
(23, 'Yap Boon Tak (YBT ICECUBE)', NULL, '', NULL, 'c_1476977794_10f06ca2129c363e3e6fa5e9006e102f.jpg', 'No.14 & 16,Lot 1277,Jalan Pantai Dalam,83000 Batu Pahat.Johor.', '<p class="p1"><span class="s1">Yap Boon Tak </span><span class="s2">大家叫他</span><span class="s1">(YBT ICECUBE) </span><span class="s2">是一家售卖</span> <span class="s2">冰块，粒冰，碎冰的公司。提供电话订购服务，附近传送。</span></p>\r\n<p class="p3"><span class="s2">Yap Boon Tak (or ommonly know as YBT ICECUBE) is in the business of providing cube ice, pebble ice and rock ice at very good prices, retailing or whole selling. Delivery service is also available in proximity distance.</span></p>', '07-4341200', 'ybticecube@hotmail.com', '', '83000', '1.845683', '102.929504', 5, '2016-10-20 23:36:34', 1, '2016-10-20', '2017-10-20', 18, 'Ice Cubes,Booking,Nearby Delivery', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '5am-7pm', 0),
(24, 'KINYUBI FOOD SDN. BHD. （金手指)', NULL, 'l_1476979020_d2b46fe0f31096f61dc88fce10d2b709.jpg', NULL, 'c_1476979020_5b4d458b7e669f29db0c61efa22416f8.jpg', '55A, Jalan Setia Jaya Utama, Taman Setia Jaya, 83000, Batu Pahat. Johor.', '<p><span class="s1">金手指早期叫新珍香，</span><span class="s2">1995</span><span class="s1">年成立。目前为止是全峇株巴辖唯一一间台式猪肉纸，之外也有肉松和传统式肉干供不同客户需求。金手指肉干不再只是佳节送礼时才能吃到的美食，特别的猪肉纸口感脆脆给你全新品尝。星期日休息。<br><br>Metamorphosed from its predecessor Xin Zheng Xiang in 1995, the birth of Kinyubi Food Sdn Bhd in the Year 2008 has seen the introduction of the one and only Taiwanese Barbecue Pork Chips to  the Batu Pahat market in addition to the traditional barbecue Pork Slices and Pork Floss. Kinyubi brings you not only barbecue Pork Slices for all seasons but also the new crispy Barbecue Pork Chips! Try it NOW!<br></span></p>', '012-770 1178', 'bakkwatissue@gamail.com', '', '83000', '1.868892', '102.944603', 6, '2016-10-20 23:57:00', 1, '0000-00-00', '0000-00-00', 12, 'chicken floss, barbecued meat, bakkwa', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '12pm-5pm', 1),
(25, 'KEDAI MAKAN & MINUMAN AN HE (安和茶餐室）', NULL, '', NULL, 'c_1476980676_75d2bd28047c4bfa295855e31371f319.jpg', 'No.59, Jalan Setia Jaya Utama, Taman Setia Jaya, 83000 Batu Pahat.Johor.', '<p><span class="s1">取名</span><span class="s2">KEDAI MAKAN & MINUMAN AN HE</span><span class="s1">，因为</span><span class="s2">TAMAN SETIA JAYA</span><span class="s1">没开发前老一辈称它安和菜巴地。安和茶餐室早市有水粿，猪肠粉和特别推荐香脆烤面包。除此之外还有当地人称她为大眼睛面粉糕。</span><span class="s2">1986</span><span class="s1">年就开始售卖面粉糕出名，她还有其他美食红酒面线和面汤类。夜市本店也售卖些糖水和</span><span class="s2">ABUBAKA</span><span class="s1">啊肥辣辣面。<br><br>Kedai Makanan & Minuman An He has its history traced back to the time before Taman Setia Jaya was built when it was a swamp area known as the "An He Land of Vegetable". Kedai Makanan & Minuman An He offers great breakfast like the traditional must-try rice cake with fried turnips (or commonly known as "Chui-Kueh" in local Hokkian dialect), "Chee-Chiong-Fun" and their specialty of toasts! In addition, Kedai Makanan & Minuman An He is also famous for its "Big-Eyed-Mee-Hun-Kueh" a soup based dough slices, since as far as 1986. Other niceties include the "Ang-Jiu-Mee-Sua" which is Rice Noodles in Chinese Red Wine, and other soup based pastas. In the evening, there''s famous Abu Bakar Fatty Hot & Spicy Noodles and traditional  Chinese desserts. <br></span></p>', '010-760 8755', 'scv22621@gmail.com', '', '83000', '1.869065', '102.944595', 5, '2016-10-21 00:24:36', 1, '2016-10-21', '2017-10-21', 12, 'Foods, Drinks, Coffee, Tea', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '6am-11pm', 1),
(26, 'SETIA JAYA KOPITIAM (白沙浮炸虾饼）', NULL, '', NULL, 'c_1476981663_de60918ce35c43abd8508b14585d7d0e.jpg', '47, Jalan Setia Jaya Utama, Taman Setia Jaya, 83000 Batu Pahat, Johor.', '<p><span class="s1">白沙浮炸虾饼在</span><span class="s2">1976</span><span class="s1">年就开始售卖炸虾饼为名。已有</span><span class="s2">30</span><span class="s1">多年之久。近期从老店搬来</span><span class="s2">SETIA JAYA UTAMA</span><span class="s1">和啊雄</span><span class="s2">ASAM PEDANS</span><span class="s1">鱼，在夜市时间售卖。早市另有经营</span><span class="s2">30</span><span class="s1">年的亚来烧腊饭。提供给客户带来更多元化的选择。</span> </p>\r\n<p>Commonly and widely known as "Bukit Pasir Crispy Deep Fried Prawn Omelette" since its inception in 1976 at Bukit Pasir, Batu Pahat, the eatery has recently moved into Taman Setia Jaya Utama with two (2) shifts. You will find the very tempting rice with barbecue pork in the morning shift from 7:30 a.m. until 4:00 p.m. followed by the ever famous signature delicacy i.e. Crispy Deep Fried Prawn Omelette in the evening shift starting at 5:30 p.m. till 11:00 p.m.  After thirty (30) long years of operation, Setia Jaya Kopitiam has added Ah Seong''s Asam Fish to its menu where customers are NOW pampered with varieties!</p>', '016-717 6799', 'ahchinhock@gmail.com', '', '83000', '1.868546', '102.944366', 5, '2016-10-21 00:41:03', 1, '2016-10-21', '2017-10-21', 12, 'Foods, drinks, kopitiam, coffee shop', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '7.30am-4pm/5.30pm-11pm', 0),
(27, 'HONEY BABY TRADING', NULL, '', NULL, 'c_1476984581_45b71a0ba060b420b271b70fc180c0ca.jpg', 'No.53, Jalan Setia Jaya Utama, Taman Setia Jaya, 83000 Batu Pahat.Johor.', '<p class="p1"><span class="s1">Honey Baby Trading </span><span class="s2">在服装业已有超过</span><span class="s1">7</span><span class="s2">年的营销经验。近俩年开始有实体店让客户直接接触挑选合适宝贝们的服饰。</span><span class="s1">Honey Baby Trading </span><span class="s2">销售各类时尚儿童服饰、卡通、泳装、晚礼服、鞋、各种关于儿童配饰等等。除此之外还售卖亲子装，以及儿童表演订制采购服装服饰。本店提供零售与批发，想要更了解详情欢迎致电与我们联系。</span></p>\r\n<p class="p2"><span class="s2">Honey baby Trading </span><span class="s3">经营概念：<br></span><span class="s1">-</span><span class="s2">商品正规<br></span><span class="s1">-</span><span class="s2">薄利多销<br></span><span class="s1">-</span><span class="s2">真诚服务客户</span></p>\r\n<p class="p2"><span class="s2">Honey Baby Trading<br></span><span class="s2">温馨提醒星期二本店休息</span> <span class="s2">，感谢您的光临和支持。</span> </p>\r\n<p class="p4"><span class="s2">Honey Baby Trading has  been in the fashion business for 7 years. However, Honey Baby Trading decided to explore into retailing floor two (2) years ago so that its customers may directly feel and enjoy the experience of selecting suitable children wear for their beloved children. Honey Baby Trading supplies various types and sizes of children wear, cartoon wear, swim wear, evening gowns and suits, footwear and accessories. In addition, Honey Baby Trading also provides family theme wear and children made to measure performance wear. For details, whether for retail or wholesale, please contact Honey Baby Trading on 013-712-3499.<br><br></span><span class="s2">The values of Honey baby Trading are</span><span class="s4">：<br></span><span class="s2">- Genuine Merchandise <br></span><span class="s2">- Affordable Pricing<br></span><span class="s2">- Sincerity </span></p>\r\n<p class="p2"><span class="s2">Honey Baby Trading closes on Tuesday. </span></p>', '013-712 3499', 'yukitew811@gmail.com', '', '83000', '1.868900', '102.94901', 5, '2016-10-21 01:29:40', 1, '2016-10-21', '2017-10-21', 15, 'baby clothing, baby wears, fashion, kids', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '-', '11.30am-9pm', 0),
(28, 'RESTORAN ASAM MANIS', NULL, '', NULL, 'c_1477559833_78899aaaabc288d33ad1dafffa995110.jpg', 'No.9, Jalan Setia Jaya 2A, Taman Setia Jaya, 83000 Batu Pahat. Johor.', '<p>Will be updated soon...</p>', '07-4334629', 'bpjohor@hotmail.com', '', '83000', '1.866589', '102.944328', 5, '2016-10-26 22:06:06', 1, '2016-10-26', '2017-10-31', 12, 'FOOD & DRINK', '8d969eef6ecad3c29a3a629280e686cf0c3f5d5a86aff3ca12020c923adc6c92', '', '8am-11pm', 0),
(29, 'LA BALLERINA PERFORMING ARTS STUDIO', NULL, '', NULL, 'c_1477492528_ddac0304b79ccdffff06fcce08916514.jpg', '1-1A,Jalan Maju Satu, Taman Maju, 83000 Batu Pahat, Johor.', '<p class="p1"><strong><span class="s1">La Ballerina Performing Arts Studio </span><span class="s2">招募新生，有各种课程</span><span class="s1">. </span></strong></p>\r\n<p class="p1"><span class="s1">#Baby Ballet / Children Creative Arts<br></span><span class="s1">-3years old & above </span> </p>\r\n<p class="p1"><span class="s1">#Gymnatics / Piano / Children Latin / Children Hip-Hop / Violin / Ballet RAD <br></span><span class="s1">-4years & above </span></p>\r\n<p class="p2"> <span class="s1">#RAD Major Ballet <br></span><span class="s1">-Intermeidate to advance level</span> </p>\r\n<p class="p1"><span class="s1"> #Belly Dance <br></span><span class="s1">-18years old & above </span></p>\r\n<p class="p2"><span class="s3">#</span><span class="s1">出租课室</span><span class="s3">  #</span><span class="s1">婚礼表演</span><span class="s3"> </span></p>\r\n<p class="p1"><span class="s1">La Ballerina Performing Arts Studio is regularly running on several intakes of students a year with variety of classes: <br></span><span class="s1">#Baby Ballet / Children Creative Arts <br>-3years old & above </span></p>\r\n<p class="p1"><span class="s1">#Gymnastics / Piano / Children Latin / Children Hip-Hop / Violin / Ballet RAD <br></span><span class="s1">-4years & above </span></p>\r\n<p class="p1"><span class="s1">#RAD Major Ballet <br></span><span class="s1">-intermediate to advance level </span></p>\r\n<p class="p1"><span class="s1">#Belly Dance <br></span><span class="s1">-18years old & above </span></p>\r\n<p class="p1"><span class="s1">We also provide rental of class rooms and wedding performances.</span></p>', '013-793 0909', 'laballerina090@gmail.com', '', '83000', '1.868817', '102.944725', 6, '2016-10-26 22:35:27', 1, '2016-10-26', '2017-10-31', 21, 'Studio,  Belly Dance ,Children Creative Arts', '8d969eef6ecad3c29a3a629280e686cf0c3f5d5a86aff3ca12020c923adc6c92', '', '12pm-10pm (monday-friday), 9am-6pm (satuurday), 12pm-4pm (sunday)', 0),
(30, 'K FOUR SNOOKER CENTER', NULL, '', NULL, 'c_1477561835_1a2cfa61dc12ce1ffa0c6ae82543d633.jpg', '62A, 64A, JALAN FLORA UTAMA 3, TAMAN FLORA UTAMA, 83000 BATU PAHAT, JOHOR.', '<p class="p1"><span class="s1">K FOUR SNOOKER CENTER </span><span class="s2">桌球娱乐中心。可以在这里打桌球练练球技，也能在此处购买到你心仪的球杆。这里还有得玩飞镖，玩累了有沙发坐着休息下喝饮料看看电视节目。<br><br></span>K FOUR SNOOKER CENTER is more than just a snooker centre where you can practise your snooker skills, you can find snooker cues that fits you. You can also go for a few games of darts while relaxing yourself with a few drinks in good company. Don''t forget there are television channels and programmes for you to flip on if you have had enough of the bullseyes.</p>', '013-721 1424', 'yyyu_my@yahoo.com', '', '83000', '1.869556', '102.948044', 7, '2016-10-27 17:50:34', 1, '2016-10-27', '2017-10-31', 16, 'snooker', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', 'Operation 11am', 1),
(31, 'CLOVER WEDDING PLANNING STATION', NULL, '', NULL, 'c_1477578647_41ad7dc787bdd081985f59a31fd8517d.jpg', 'No. 40, JALAN BANANG RIA 6, TAMAN BANANG RIA, 83000 BATU PAHAT, JOHOR.', '<p class="p1"><span class="s1">Since 2008, Clover Live Band has been building up the enviable reputation of being one of the best and most exciting bands around Malaysia, especially for wedding banquet.</span></p>\r\n<p class="p1"><span class="s1">We have been performing at numerous high profile venues and events around Malaysia including Sunway hotel, Nikko hotel, First world hotel, Federal hotel, Eastin hotel, Shangri la hotel, Park royal hotel, Ritz carlton hotel, The Rain forest country club, Halo cafe, Wings cafe, Station 1 cafe, and more. With experience, we assure you a romatic and happy surrounding throughout your wedding dinner.</span></p>\r\n<p class="p1"><span class="s1">From pop to jazz throgh the 80’s and now. whether it’s singing the many version of everlasting love song. Clover Live Band provides an exceptionally wide repertoire. Let our romantic rhythm and touching voices move your heart, celebrate a moment of love and happiness.<br> </span></p>\r\n<p class="p3"><span class="s1">自</span><span class="s2">2008</span><span class="s1">年以来，三叶草乐队已经树立为马来西亚最好以及最令人激赏的乐队之一，尤其以婚宴与喜宴而闻名。</span></p>\r\n<p class="p3"><span class="s1">自此，三叶草乐队就一直出入马来西亚高格调场所与盛事比如，双威酒店、</span><span class="s2">Nikko</span><span class="s1">酒店、第一世界酒店、联邦酒店、</span><span class="s2">Eastin</span><span class="s1">酒店、香格里拉酒店、</span><span class="s2">Park Royal</span><span class="s1">酒店、加尔顿酒店、热带雨林俱乐部、海螺咖啡厅、</span><span class="s2">Wings </span><span class="s1">咖啡厅、</span><span class="s2">Station 1 </span><span class="s1">咖啡厅</span> <span class="s1">等等。秉持丰富的经验，三叶草乐队肯定能够为您的婚宴带来与增添快乐与罗曼迪克的气氛！</span></p>\r\n<p class="p3"><span class="s1">无论是从流行音乐到爵士音乐，</span><span class="s2">80</span><span class="s1">年代或现代，不管是清唱永恒情歌与否，三叶草乐队都能为您提供特别的广阔剧目。就让三叶草的罗曼音律与动人的歌声恻动您的心扉，欢庆爱与幸福时光。</span></p>', '016-322 8226', 'info@cloverwedding.com.my', 'www.cloverwedding.com.my', '83000', '43.1146883', '5.9488975', 5, '2016-10-27 22:30:47', 1, '2016-10-27', '2017-10-31', 20, 'live band & sound system, wedding, bridal', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '24 hours', 1),
(32, 'STYLE STEEL WORK', NULL, '', NULL, 'c_1477579420_b783365de79b31d5dafce476a74cac59.jpg', 'BATU 1 ½, JALAN MINYAK BEKU, 83000 BATU PAHAT, JOHOR.', '<p class="p1"><span class="s1">STYLE STEEL WORK </span><span class="s2">提供各种有关不锈钢订制和修理。尽力满足你所需要的各种不锈钢制成品。公司</span><span class="s1">/</span><span class="s2">住家，钢铁招牌</span><span class="s1">/</span><span class="s2">灯箱，钢铁门</span><span class="s1">/</span><span class="s2">窗框，厨房</span><span class="s1">/</span><span class="s2">橱柜，钢制酒吧柜台，各类只要你想到可以结合白钢呈现，</span><span class="s1">STYLE STEEL WORK </span><span class="s2">会为你尽力做到。</span></p>\r\n<p class="p2">STYLE STEEL WORK provides repair and all steel-made products you can possibly imagine, be it steel door of all designs, door & window frames, steel signboards, steel light boxes, kitchen cabinets, steel bar counters and almost anything you name it, Style Steel Work will make it. </p>', '012-769 0838', 'stylesteelwork@gmail.com', '', '83000', '1.824533', '102.930284', 5, '2016-10-27 22:43:39', 1, '2016-10-27', '2017-12-31', 18, 'steel, stainless steel, renovation, steel door', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '9am-6pm', 0),
(33, 'AH YAN AUTO SDN. BHD.', NULL, '', NULL, 'c_1477580589_7527c6f2c57b1ca4ca608761585386ad.jpg', 'No. 1-23, 1-25, JLN MAJU 3, TMN. MAJU 83000, BATU PAHAT, JOHOR.', '<p> <span class="s1">AH YAN AUTO SDN. BHD. </span><span class="s2">是一家提供汽车服务，修理和保养的公司。擅长以下车款：</span><span class="s1">- <br></span><span class="s2">-BMW <br></span><span class="s2">- MERCEDES-BENZ <br></span><span class="s2">-TOYOTA <br></span><span class="s2">-HONDA <br></span><span class="s2">-NISSAN <br></span><span class="s2">-MITSUBISHI <br></span><span class="s2">-KIA </span> </p>\r\n<p class="p2"><span class="s2">AH YAN AUTO SDN. BHD. <br></span><span class="s3">推荐：</span><span class="s2">- BIZOL Green Oils <br></span><span class="s2">100% German Quality </span></p>\r\n<p class="p2"><span class="s2">AH YAN AUTO SDN. BHD. , a car service company specialises in maintenance and repair of various car types:- <br></span><span class="s2">-BMW <br></span><span class="s2">- MERCEDES-BENZ <br></span><span class="s2">-TOYOTA <br></span><span class="s2">-HONDA <br></span><span class="s2">-NISSAN <br></span><span class="s2">-MITSUBISHI <br></span><span class="s2">-KIA </span></p>\r\n<p class="p2"><span class="s2">AH YAN AUTO SDN BHD recommends Bizol Green Oil which is of 100% German Quality!</span></p>', '07-4300944', 'ahyan_auto5561@hotmail.com', '', '83000', '43.1146883', '5.9488975', 6, '2016-10-27 23:03:08', 1, '2016-10-27', '2017-12-31', 17, 'car service, car maintenance, car workshop', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '8.30AM-5.30PM (OFF SUNDAY)', 1),
(34, 'MAIDFORYOU CLEANING SERVICE', NULL, '', NULL, 'c_1477582096_0f448abc7de6eeda8ac7b3e861426261.jpg', '11, Jalan Puteri Indah 1/1, Taman Puteri Indah, 83000 Batu Pahat. Johor.', '<p dir="ltr">我们的服务目前只局限于峇株巴辖。想要更了解请联系我们。</p>\r\n<p dir="ltr">提供以下选择<br>-钟点女佣<br>-日租女佣<br>-月租女佣</p>\r\n<p dir="ltr">我们每日俩班<br>-8am-1pm / 2pm-7pm</p>\r\n<div dir="ltr">目前收费分成俩个时间<br class="kix-line-break">-5小时<br>-10小时</div>\r\n<div dir="ltr"> <br>Our services is currently confined to the Batu Pahat area.Please contact us for more details.</div>\r\n<p dir="ltr">We provide:<br>-Hourly Maid Services<br>-Daily Maid Services<br>-Monthly Maid Services</p>\r\n<div dir="ltr">We currently run two shifts:-<br>-8am-1pm / 2pm-7pm</div>\r\n<div dir="ltr"> <br>Our current charges are based on:-<br>-5 hours slot<br><span id="docs-internal-guid-010112b7-06b7-2d9a-1def-7183ddc89e45">-10 hours slot<br class="kix-line-break"></span></div>', '013-715 0909', 'maidd4u.bp@gmail.com', '', '830000', '1.868817', '102.944725', 6, '2016-10-27 23:28:16', 1, '2016-10-27', '2017-10-31', 18, 'cleaning, hourly maid service, house cleaning', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '8am-1pm / 2pm-7pm', 1),
(35, 'SISTER BEAUTY', NULL, '', NULL, 'c_1477844514_8bdf7555f895b6179a67ee9ce21e7731.jpg', 'NO.67, JALAN SETIA JAYA UTAMA, TAMAN SETIA JAYA, 83000 BATU PAHAT. JOHOR.', '<p class="p1"><span class="s1">SISTER BEAUTY</span><span class="s2">，</span><span class="s1"> the ONE-STOP beauty centre that provides you with following beautification and beautifying services:-</span></p>\r\n<p class="p1"><span class="s1">- facial, eyebrows, eyelashes, eye lining <br></span>- Sliming, massages, Spa<br>- Womb treatment</p>\r\n<p class="p1"><span class="s1">SISTER BEAUTY also provides eyelashes classes. <br></span><span class="s1">For enquiries, please do not hesitate to contact us.  </span>In order to serve you better, pre-booking is encouraged. </p>\r\n<p class="p1"><span class="s1">SISTER BEAUTY </span><span class="s2">美容服务：</span><span class="s1">-<br></span><span class="s3">-</span><span class="s1">洗脸，眉毛，</span> <span class="s1">睫毛，</span> <span class="s1">眼线<br></span><span class="s3">-</span><span class="s1">瘦身，按摩，</span><span class="s3">Spa<br></span><span class="s3">-</span><span class="s1">子宫护理</span> </p>\r\n<p class="p3"><span class="s3">SISTER BEAUTY </span><span class="s1">提供睫毛课程，想更了解详情请联系我们。我们也提供预定时间，让你能得到时间上更好服务。</span></p>', '012-790 0701', 'jolene0701@gmail.com', '', '83000', '1.870206', '102.946968', 6, '2016-10-31 00:21:54', 1, '2016-10-31', '2017-10-31', 15, 'Facial, Slimming, Massage, Spa', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '10am-7pm (Off Monday)', 1),
(36, 'Q SPORT VANTAGE', NULL, '', NULL, 'c_1477846705_eb039f7a87a02eac2ba3b19820c0c1a0.jpg', '50A, 51A, JALAN FLORA UTAMA 4, TAMAN FLORA UTAMA, 83000 BATU PAHAT. JOHOR.', '<p class="p1"><span class="s1">Q SPORT VANTAGE </span><span class="s2">桌球娱乐的好地方。</span> <span class="s2">除了练习球技也售卖球杆。</span><span class="s1">Q SPORT VANTAGE </span><span class="s2">店里也售卖杯面，零食和饮料。还提供沙发和电视，在练球累时稍作休息的地方。</span><span class="s1"><br> <br></span><span class="s2">Look no further! Q SPORT VANTAGE provides you a great place for snookering.  Apart from training, you will be able to find the best of snooker cues in Q Sport Vantage where drinks, tit-bits, noodles are also available to be served at the convenience of your sofas and TVs after a few challenging games. </span></p>', '012-777 5299', 'qspotvantage@gmail.com', '', '83000', '1.862587', '102.947174', 4, '2016-10-31 00:58:25', 1, '2016-10-31', '2017-10-31', 16, 'SNOOKER, DRINK & FOOD', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', 'Operation 10am', 1),
(38, 'H SUPER BREAD', NULL, '', NULL, 'c_1477850096_86e0dd4101ff67a4cfa537b7d58012fa.jpg', '89, JALAN SETIA JAYA UTAMA, TAMAN SETIA JAYA, 83000 BATU PAHAT. JOHOR.', '<p class="p1">H Super Bread 大家称面包超人。 H Super Bread售卖新鲜面包不含防腐剂。本店特别推介超级面包。早上8am-6pm也有茶水，面食类。7pm后都会有特别优惠。想了解更多详情欢迎致电联系我们。温馨提醒：-星期四休息.</p>\r\n<p class="p1">H Super Bread or widely known as Bread Superman bakes fresh bread with no added preservatives. H Super Breads operates daily, except Thursday, from 8am till 6pm with great offers after 7pm daily. Drinks and pastas are also served. H Super Bread especially recommends the Super Bread. For more details, call 012-7918556</p>\r\n<p class="p1"><a href="https://www.facebook.com/pages/H-Super-Bread-面包超人/659916054099394">Link to our Facebook</p>\r\n<p class="p1"></a></p>', '012-791 8556', 'hsuperbread@gmail.com', '', '83000', '1.868593', '102.945213', 12, '2016-10-31 01:54:55', 1, '2016-10-31', '2017-10-31', 12, 'FOOD & DRINK, bread,', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '8am-9.30pm', 1),
(39, 'FOUNTAIN BISTRO', NULL, '', NULL, 'c_1477851128_eeb26edf52a94ed7f7c1c297b91fd8f1.jpg', 'NO. 44, 44A, & 46, 46A, JALAN FLORA UTAMA 8, TAMAN FLORA UTAMA, 83000 BATU PAHAT. JOHOR.', '<p class="p1"><span class="s1">FOUNTAIN BISTRO </span><span class="s2">是休闲聊天的娱乐好去处。备有好几台飞镖机，小型桌球一张。还有各种饮料和食物。每逢星期六</span><span class="s1"> FOUNTAIN BISTRO  </span><span class="s2">有</span><span class="s1">DJ</span><span class="s2">秀，偶尔也会有音乐表演之类。提供预订桌位服务。温馨提醒，我们的</span><span class="s1">HAPPY HOUR</span><span class="s2">时段是</span><span class="s1">6pm-10pm</span><span class="s2">。<br><br></span><span class="s2">FOUNTAIN BISTRO is indeed a wonderful venue for relaxation, socialising, and entertainment whether you feel like flying a few darts or having a game of snooker.  FOUNTAIN BISTRO operates daily with HAPPY HOURS from 6pm to 10pm and serves various types of food & drinks whilst you enjoy music performances and DJ show. Pre-booking is encouraged.</span></p>', '012-777 5299', 'fountainbistro@gmail.com', '', '83000', '1.862587', '102.947174', 7, '2016-10-31 02:12:08', 1, '2016-10-31', '2017-10-31', 16, 'DRINK, FOOD, ENTERTAINMENT', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '6pm-3am', 1),
(40, 'FREEDOMSKY TRADING', NULL, '', NULL, 'c_1477935145_68a45fc90516476146cea44949a63325.jpg', '127, JALAN RAHMAT, 83000 BATU PAHAT. JOHOR.', '<p class="p1"><span class="s1">Freedomsky Trading </span><span class="s2">称翔の燕，是一家销售燕窝公司。<br></span><span class="s1">在烦恼送什么吗？燕窝绝对是送礼的最佳选择，高贵大方不失体面。本公司以电话联系销售，优惠不断。欢迎致电询问订购。</span></p>\r\n<p class="p3"><span class="s1">Freedomsky Trading </span><span class="s2">：</span><span class="s1">-<br></span><span class="s3">-</span><span class="s1">批发，零售。<br></span><span class="s3">-</span><span class="s1">婚礼供应（一口燕）。<br></span><span class="s3">-</span><span class="s1">鲜炖即开即喝等各种类型。</span></p>\r\n<p class="p2"><span class="s1">温馨提醒：</span><span class="s3">-<br></span><span class="s3">-</span><span class="s1">鲜炖，需提早一日预订。<br></span><span class="s3">-</span><span class="s1">婚宴（一口燕），需提早一个月预订。</span></p>\r\n<p class="p1"><span class="s1">Freedomsky Trading or the flying swallow (in its Chinese name) is a bird''s nest trading company. </span><span class="s1">Still worrying about presenting a gift? Bird''s nest is doubtlessly to be the best gifts of all choices, it''s tasteful, privileged & dignified. </span><span class="s1">Freedomsky Trading operates its bird''s nest business through tele-marketing with great offers to its customers. For details, please do joy hesitate to contact Freedomsky Trading on </span><span xss=removed>017-718 1919</span></p>\r\n<p class="p1"><span class="s1">In summary, Freedomsky Trading offers:-<br></span><span class="s1">- wholesale and/ or retailing of bird''s nest<br></span><span class="s1">- Wedding banquet supplies (Single serving bird''s nest)<br></span>- Freshly brewed instant bird''s nest and many more</p>\r\n<p class="p3">A kind reminder:-<br><span class="s1">- For freshly brewed instant bird''s nest, 24 hours pre-booking is required. <br></span>- For wedding banquet supplies (Single serving birds'' nest), a 30-day pre-booking is required.</p>', '017-718 1919', 'sred520025@gmail.com', '', '83000', '1.850073', '102.927129', 6, '2016-11-01 01:32:25', 1, '2016-11-01', '2017-11-01', 12, 'BIRD’S NEST', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '9am-9pm', 1),
(41, 'JL Beauty Creation Academy', NULL, '', NULL, 'c_1477936989_89ea323409d8313b42c5b7eb355b1fdb.jpg', 'No. 53, Jalan Flora Utama 3, Taman Flora Utama, 83000 Batu Pahat, Johor', '<p>JL Beauty Creation provides professional makeup services to bride and event in addition to offering professional makeup courses daily from 11 a.m. - 7 p.m.</p>\r\n<p>In order to ensure our students are always at the forefront of the latest makeup innovations, techniques, products and trends, we constantly review, improve and update our courses and curriculums. </p>\r\n<p>In fact, JL Beauty Creation is among the pioneers to introduce office makeup set and eyebrows lining in the market. </p>\r\n<p>To avoid disappointment and to ensure best of service, pre-booking is encouraged. Please call NOW for an appointment at 016-778-8857. </p>', '016-77788857', 'beautycreation88@gmail.com', '', '83000', '1.8675729', '102.9482365', 4, '2016-11-01 02:00:36', 1, '2016-11-01', '2017-11-01', 15, 'The Specialize makeup, eyelash extension', '5994471abb01112afcc18159f6cc74b4f511b99806da59b3caf5a9c173cacfc5', '', '8:30am - 6pm', 1);
