(2, 2, 'Product Showing Event', '100E Pasir Panjang Road #08-01 Century Warehouse Singapore', '1469073143.png', NULL, 'Every single design is hand made from the finest materials such as solid wood, wool, metallic, marble, leather and love.""', 'http://kuhlhome.com', '2016-08-06', 1, '2016-06-08 12:50:45', 0, '2016-06-09', '2016-07-29'),
(3, 1, 'Sa Sa Announces Sales Performance', '10 Tampines Central 1, #02-36 Tampines 1', '1469073183.jpg', NULL, 'The Group’s year-on-year growth in retail sales in Hong Kong and Macau remained flat* during the\r\nLabour Day Holiday 2016 as compared to last year (namely 1 to 3 May 2015), while the year-on-year\r\ngrowth in same store sales was approximately 1%*."', 'http://corp.sasa.com', '2016-09-09', 3, '2016-06-08 13:14:49', 0, '2016-06-13', '2016-06-30'),
