INSERT INTO `job` (`jb_id`, `customer_id`, `jb_name`, `jb_description`, `jb_salary`, `jb_location`, `jb_like_count`, `jb_expired`, `jb_created`, `jb_modified`, `jb_status`, `paid_ads_start_date`, `paid_ads_end_date`, `jb_email`, `jb_phone`) VALUES
(1, 1, 'Shop Assistant', '<p>At least 5-8 years’ work experience comprising: - Minimum 4 years sales management and or supervising dealers sales rep in a telecommunications industry –</p>', '1000', '2 Tampines Central 5, #01-03 Century Square, Singapore', 2, '2016-08-31', '2016-06-08 12:53:58', '2016-08-04 16:07:44', 0, '2016-06-08', '2016-06-30', 'sasa@gmail.com', '0944883456'),
(2, 2, 'Regional Sales Manager', '<p>Every single design is hand made from the finest materials such as solid wood, wool, metallic, marble, leather and love.</p>', '1000', '100E Pasir Panjang Road #08-01 Century Warehouse Singapore', 1, '2016-08-18', '2016-06-08 12:54:53', '2016-08-17 09:10:12', 0, '2016-06-08', '2016-08-18', 'furnituremart@gmail.com', '0924532532'),
(3, 14, 'Designer', '<p class="p1"><span class="s1">Support Content Marketing and Designing for both Internal Communications & Engagement and New Digital Workplace.<br><br> - To create content that will be compelling for the internal customers to increase usage for intranet and increase employee engagement. <br> - To design and develop multiple communication channel & engagement platforms and achieve significant levels of viewers<br> - To translate user needs and business goals into effective user experiences for the web. This includes some combination of user experience research, Content Strategy, Information Architecture.<br> - Produced multimedia content e.g. graphics, video.<br> - Must have interest and passion in writing/producing online content<br> - Strong focus on the user and passionate about the customer experience and usability.<br> - Assist with other ad hoc tasks as required.</span></p>\n<p> </p>\n<p class="p1"><span class="s1"><strong>Requirements:</strong><br> - MS Office, Photoshop, Infographics<br> - Experience in visual designing in developing fun, highly usable and creative concepts for the Web and infographics.<br> - Experience in user experience research, Content Strategy, Visual Design</span></p>', 'RM3000', 'Batu Pahat', 0, '2016-11-30', '2016-09-20 21:27:12', '2016-09-20 22:25:39', 0, '2016-09-20', '2016-12-31', 'patrick@kenzocreatives.com', '0127625999');
