INSERT INTO `product` (`pro_id`, `customer_id`, `pro_title`, `pro_image_name`, `pro_image_base64`, `pro_price`, `pro_price_text`, `pro_discount_type`, `pro_discount_amount`, `pro_quantity`, `pro_description`, `pro_is_deal`, `pro_is_promotion`, `pro_like_count`, `pro_expired_date`, `pro_status`, `pro_created`, `paid_ads_start_date`, `paid_ads_end_date`, `pro_total_viewer`, `pro_surprise_marked`) VALUES
(1, 2, 'SK-CLR- Coffee Table', '1469076461.jpg', NULL, 299, NULL, '$', 10, 10, '<p>Description: - Solid MDF + Plywood - Black design glass top - 2 x Drawer - Metal legs</p>', 1, 0, 0, '2016-08-31', 0, '2016-06-08 13:00:53', '0000-00-00', '0000-00-00', 0, '0'),
(3, 1, 'NYX', '1469076664.jpg', NULL, 30, NULL, '$', 5, 50, '<p>Demand Perfection! For that fresh make up look that lasts, NYX Makeup Setting Sprays are lightweight and comfortable while working hard to make sure your makeup stays put. Available in a gorgeous Matte Shine-Free Finish or Dewy fresh glow.</p>', 1, 1, 2, '2016-08-31', 0, '2016-07-01 16:18:45', '2016-07-01', '2016-07-31', 10, '0'),
(4, 1, 'NYX Baked Blush', '1469076735.jpg', NULL, 20, NULL, '$', 2, 50, '<p>NYX Baked Blush Baked to sheer perfection, this luxurious formula is packed full of pigments to provide a natural glow and highlight to the face. Uniquely designed to be used wet or dry, depending upon the makeup statement you want to make. When used dry with a brush, the look is light and fresh. Want more color? No Problem! Apply wet with a makeup sponge for more intensity.</p>', 0, 1, 0, '2016-08-31', 0, '2016-07-01 16:22:10', '2016-07-01', '2016-08-31', 2, '0'),
(5, 1, 'NYX Blotting Powder', '1469077291.jpg', NULL, 30, NULL, '$', 5, 15, '<p>Kissed with the barest hint of pigment, Blotting Powder takes down the shine without settling into fine lines, polishing skin to satin matte perfection.</p>', 1, 1, 3, '2016-08-31', 0, '2016-07-01 17:12:43', '2016-07-01', '2016-08-29', 14, '0'),
(7, 14, 'Ironman Led Lamp', '1471455732.jpg', NULL, 50, '', '$', 10, 10, '<p>ALL BRAND NEW - Stocks Available Now! Branding Options: Acrylic part: Laser Engraving Base part: Silk printing Accessories: Switch cable Material: Silicon + Acrylic 4 Base color to choose from: 1) Pink 2) Blue</p>', 0, 1, 8, '2017-04-27', 0, '2016-08-18 01:42:12', '2016-08-18', '2016-11-30', 505, '0'),
(9, 18, 'With RM200 package/year, GET 3 Months Free', '1476507657.jpg', NULL, 200, NULL, '$', 0, 10, '<p>Pay as low as RM200/year and entitle to have additional 3 more months of advertising. Promo ends before 16 November.</p>', 0, 0, 0, '2016-11-30', 0, '2016-10-15 12:29:05', '2016-10-15', '2016-11-30', 14, '1'),
(10, 18, 'With RM2000 package/year, GET 3 Months Free', '1476507674.jpg', NULL, 2000, NULL, '$', 0, 10, '<p>Pay as low as RM2000/year and entitle to have additional 3 more months of advertising. Promo ends before 16 November.</p>', 0, 0, 0, '2016-11-30', 0, '2016-10-15 12:33:36', '2016-10-15', '2016-11-30', 4, '1'),
(12, 18, 'Batu Pahat''s First App', '1476541755.jpg', NULL, 0, NULL, '$', 0, 10, '<p>迈入手机程式时代，广告随身、随时、随地，既环保又经济！别犹豫了，赶快拨 016-7960-787（Nick）询问与示范。 INSERT INTO `product_image` (`pro_img_id`, `pro_id`, `pro_img_base64`, `pro_img_name`) VALUES
